import React from "react";

const Field = ({
  number = false,
  placeholder = false,
  icon = false,
  select = false,
}) => {
  return (
    <div className="inline bg-slate-700 text-slate-200 border-0 text-sm rounded block w-full px-3 py-2">
      <i className="fal fa-magnifying-glass px-3" />
      <input type="text" className="allunset bg-slate-700" />
    </div>
  );
};

export default Field;
